import React from 'react'
import * as IoIcons from 'react-icons/io';

export const SidebarData = [
    {
        title: 'Home',
        path: '/',
        cName: 'nav-text',
        imageSrc: '../images/profile.png',
        name: 'home'
    },
     {
        title: 'About me',
        path: '/about-me',
        cName: 'nav-text',
        imageSrc: '../images/me.png',
        name: 'about'
    }
]
